                //     alt="Alternate Text"
                // />
            })}
        </HStack>
        </Stack>
    )
}

export const HorizontalStack = () => {
  return (
    <NativeBaseProvider>
      <Center flex={1} px="3">
        <Example />
      </Center>
    </NativeBaseProvider>
  )
}
